import "./Navbar.css"

const Navbar = () => {
  return (
    <nav>
      {/*Logo*/}
      <a href="#" class="logo">Resume</a>
      {/*Menu*/}
      <ul>
        <li><a href="portfolio1.html" class="active">Home</a></li>
        <li><a href="portfolio1.html">About</a></li>
        <li><a href="resume.html">Resume</a></li>
        <li><a href="contact.html">Contact</a></li>
      </ul>
      <img src='././assets/menu.png' className=''></img>
    </nav>
  )
}

export default Navbar
